INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 4.19, 7, 1, 0, 9, 5, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 3, 12300152, 2, "vo_minigame_1012_result_1084");
INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 1, 0.0, 1, 1, 0, 9, 5, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 3, 12300153, 2, "vo_minigame_1012_result_1085");
