INSERT INTO `v1_d38b45a718948415c63ec3443a784ee1508dea3eed33c69a9ea1a5bb68defe0f` VALUES (3001, 10, 4.29, 4, 2, 3, 4, 1, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 2, 22300160, 2, "vo_minigame_1012_result_2092");
